import React from "react";
import Square from "./Square.js";

const cell = {
  value: 9,
  prefilled: false,
};

const Grid = () => {
  const grid = [];
  for (let row = 0; row < 10; row++) {
    grid.push([]);
    for (let col = 0; col < 10; col++) {
      grid[row].push(<Square key={`${col}${row}`} color="1" />);
    }
  }
  return <div>{grid}</div>;
};

export default Grid;
